//	Here the function is to draw a sentence; Input: str (data type = char*)
void drawString(const char* str) {
    static int isFirstCall = 1;
    static GLuint lists;
    if (isFirstCall) {
        isFirstCall = 0;
        lists = glGenLists(MAX_CHAR);
        wglUseFontBitmaps(wglGetCurrentDC(), 0, MAX_CHAR, lists);
    }
    for (; *str != '\0'; ++str) {
        glCallList(lists + *str);
    }
}

// Function used to set the font.
void selectFont(int size, int charset, const char* face) {
    HFONT hFont = CreateFontA(size, 0, 0, 0, FW_MEDIUM, 0, 0, 0,
        charset, OUT_DEFAULT_PRECIS, CLIP_DEFAULT_PRECIS,
        DEFAULT_QUALITY, DEFAULT_PITCH | FF_SWISS, face);
    HFONT hOldFont = (HFONT)SelectObject(wglGetCurrentDC(), hFont);
    DeleteObject(hOldFont);
}

//	Calculate the x and y of the points on the target circle.
double circle_x(double R, double N, double n) { return R * cos(2.0 * pi / N * n); }
double circle_y(double R, double N, double n) { return R * sin(2.0 * pi / N * n); }

