//	Timer: update the variables according to the time. 
void OnTimer(int value) {
    if (!StopChange)center_color = (center_color + 1) % ColorList_N;
    if (!StopChange)circle_NO = (circle_NO + 1) % circle_SIZE;
    if (open)
        for (int i = 0; i < movingWords_SIZE; i++) {
            xs[i] -= step;
            if (xs[i] < 0)xs[i] = width;
        }
    if (!open) {
        dy += openSpeed;
    }
    glutTimerFunc(timeInterval, OnTimer, 1);
}

int WordsColor = 1;	//  The number in the list of the words' color.
int viewState = 1;	//  The bullet screen's state (shown / hidden). 
int FillColor = 0;  //  The CB filled color or not. 

//	Keyboard interactions.
void keyboardInput(unsigned char key, int x, int y) {
    if (key == 'q' || key == 'Q' || key == 27) exit(0);
    else if (key == 'c' || key == 'C') viewState = 0;
    else if (key == 'v' || key == 'V') viewState = 1;
    else if (key == 's' || key == 'S') StopChange = 1;
    else if (key == 'r' || key == 'R') StopChange = 0;
    else if (key == 'f' || key == 'F') FillColor ^= 1;
}

//	Mouse interactions.
void mouseInput(int button, int state, int x, int y) {
    if (state == GLUT_DOWN && button == GLUT_LEFT_BUTTON) WordsColor = (WordsColor + 1) % words_Color_TYPE;
    else if (state == GLUT_DOWN && button == GLUT_RIGHT_BUTTON) WordsColor = (WordsColor + 1) % words_Color_TYPE;
}

void displayMovingWords() {
    glColor3f(GLfloat(6.0 / 255.0), GLfloat(66.0 / 255.0), GLfloat(205.0 / 255.0));
    for (int i = 0; i < movingWords_SIZE; i++) {
        selectFont(72, ANSI_CHARSET, "Comic Sans MS");
        if (i == 1 || i == 3 || i == 10) glColor3f(1.0, 0.2, 0.2);
        else if (i == 2 || i == 11 || i == 7) glColor3f(GLfloat(6.0 / 255.0), GLfloat(66.0 / 255.0), GLfloat(205.0 / 255.0));
        else glColor3f(0.8, 0.8, 0.8);
        glRasterPos2f(GLfloat(xs[i]), GLfloat(ys[i]));
        drawString(movingWords[i]);
    }

}

