void displayBackground() {
    glBegin(GL_POLYGON);
    glColor3f(0.412, 0.188, 0.529);
    glVertex2f(0, 0);
    glColor3f(0.725, 0.318, 0.729);
    glVertex2f(2048, 0);
    glColor3f(0.412, 0.188, 0.529);
    glVertex2f(2048, 1448);
    glColor3f(0.098, 0.063, 0.329);
    glVertex2f(0, 1448);
    glEnd();
}

