void displayIcon();
void displayWords();

void displayCircleBackground() {
    double n = 5000.0;
    double x0 = 1024, y0 = 724;
    double R = 800.0;
    glBegin(GL_POLYGON);
    glColor3f(ColorList[center_color][0], ColorList[center_color][1], ColorList[center_color][2]);
    int counter = 0;
    for (double i = 0; i < n; i++) {
        glVertex2f(GLfloat(circle_x(R * rr[circle_NO], n, i) + x0), GLfloat(circle_y(R * rr[circle_NO], n, i) + y0));
    }
    glEnd();
}

void displayCoverUP() {
    glBegin(GL_POLYGON);
    glColor3f(0.9411, 0.9216, 0.8353);// rice color
    glVertex2i(0, 1448 + dy);
    glVertex2i(2048, 1448 + dy);
    glVertex2i(2048, 724 + dy);
    glVertex2i(1024, 456 + dy);
    glVertex2i(0, 724 + dy);
    glEnd();

    glColor3i(0, 0, 0);
    glLineWidth(5.0);
    glBegin(GL_LINES);
    glVertex2i(0, 1448 + dy);
    glVertex2i(2048, 1448 + dy);
    glVertex2i(0, 1448 + dy);
    glVertex2i(0, 724 + dy);
    glVertex2i(2048, 1448 + dy);
    glVertex2i(2048, 724 + dy);
    glEnd();

    glLineWidth(3.0);
    glBegin(GL_LINES);
    glLineWidth(3.0);
    glVertex2i(1024, 456 + dy);
    glVertex2i(2048, 724 + dy);
    glVertex2i(0, 724 + dy);
    glVertex2i(1024, 456 + dy);
    glEnd();

    if (456 + dy > 2048)open = true;
}

void displayCoverDOWM() {
    glBegin(GL_POLYGON);
    glColor3f(0.9411, 0.9216, 0.8353);// rice color
    glVertex2i(0, 0 - dy);
    glVertex2i(2048, 0 - dy);
    glVertex2i(2048, 724 - dy);
    glVertex2i(0, 724 - dy);
    glEnd();

    glColor3i(0, 0, 0);
    glLineWidth(5.0);
    glBegin(GL_LINES);
    glVertex2i(0, 0 - dy);
    glVertex2i(2048, 0 - dy);
    glVertex2i(2048, 0 - dy);
    glVertex2i(2048, 724 - dy);
    glVertex2i(0, 724 - dy);
    glVertex2i(0, 0 - dy);
    glEnd();

    glLineWidth(3.0);
    glBegin(GL_LINES);
    glVertex2i(2048, 724 - dy);
    glVertex2i(0, 724 - dy);
    glEnd();
}

void display() {
    glClearColor(1, 1, 1, 1);
    glClear(GL_COLOR_BUFFER_BIT);
    glMatrixMode(GL_PROJECTION);
    glLoadIdentity();
    gluOrtho2D(0, 2048, 0, 1448);
    glLineWidth(1.0);
    displayBackground();
    displayCircleBackground();

    if (FillColor) {
        fillingCBWalls();
    }
    displayCB();
    displayIcon();
    displayWords();
    displayOperationHelpWords();
    if (viewState) {
        displayMovingWords();        
    }
    if (!open) {
        displayCoverDOWM();
        displayCoverUP();
    }
    glFlush();
}

//	Begin the main method.
